import React from 'react';
import Paper from "@material-ui/core/Paper";


export default function Questions(props) {

    const test = props => {
        props.getQuestId(props.id);
    }
    console.log(test);


    return(
        <Paper>
            <h1>Detail's page</h1>  
            <p>{test.category}</p>
        </Paper>
    )
}
